class Solution
{
public:
    int minimumBuckets(string street)
    {
        vector<int> dp(street.size(), -1);
        int _sum = 0, _sumB = 0;
        for (int i = 0; i < street.size(); i++)
        {
            if (street[i] == 'H')
            {
                if (i - 1 >= 0 && street[i - 1] == '.')
                {
                    continue;
                }
                if (i + 1 < street.size() && street[i + 1] == '.')
                {
                    
                    continue;
                }
                return -1;
            }
        }
        
        for(int i = 0; i < street.size(); i++)
        {
            if (i + 2 < street.size() && street[i] == 'H' && street[i + 1] == '.' && street[i + 2] == 'H')
            {
                street[i] = '3';
                street[i+1] = 'B';
                street[i+2] = '3';
                i+=2;
                _sumB++;
                continue;
            }
        }
        for(int i = 0; i < street.size(); i++)
        {
            if (i + 1 < street.size() && street[i] == 'H' && street[i + 1] == '.')
            {
                street[i] = '1';
                street[i+1] = 'B';
                i+=1;
                _sumB++;
                continue;
            }
        }
        for(int i = 0; i < street.size(); i++)
        {
            if (i + 1 < street.size() && street[i] == '.' && street[i + 1] == 'H')
            {
                street[i] = 'B';
                street[i+1] = '1';
                i+=1;
                _sumB++;
                continue;
            }
        }
        
        /*
        while (street.find("H.H")<street.size())
        {
            auto it = street.find("H.H");
            street.replace(it,3,"XBX");
            _sumB++;
        }
        while (street.find("H.")<street.size())
        {
            auto it = street.find("H.");
            street.replace(it,2,"XB");
            _sumB++;
        }
        while (street.find(".H")<street.size())
        {
            auto it = street.find(".H");
            street.replace(it,2,"BX");
            _sumB++;
        }
        */
        return _sum;
    }
};
